function ProjectItem({ image, name, id, url }) {
  return (
    <a href={url} target="_blank" type="event">
      <div className="projectItem">
        <div style={{ backgroundImage: `url(${image})` }} className="bgImage" />
        <h1> {name} </h1>
      </div>
    </a>
  );
}

